import React, {Fragment} from 'react';
import Menu from '../menu/Menu';
import Img from '.'

const Header = ({src}) => {
    const menuItem = [
        { id: 1, name: 'home'},
        { id: 2, name: 'portfolio'},
        { id: 3, name: 'about us'},
        { id: 4, name: 'price'},
        { id: 5, name: 'contacts'}
      ];
    return(
        <Fragment>
            <h1>
                <a href="#">                
                    <img src={src}/>
                </a>
            </h1>
            <Menu items={menuItem}/>
        </Fragment>
    )
}

export default Header;
